import"./hoisted.CNm4v15S.js";document.getElementById("clubForm")?.addEventListener("submit",async e=>{e.preventDefault();const t=e.target,r=new FormData(t),n={name:r.get("name"),logo:r.get("logo")||null,is_mcdo_pool:r.get("is_mcdo_pool")==="on"};try{const o=await fetch("/api/clubs",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(n)});if(!o.ok){const a=await o.json();throw new Error(a.message||"Error creating club")}window.location.href="/admin/clubs"}catch(o){console.error("Error:",o),alert(o instanceof Error?o.message:"Error creating club")}});
